import React from 'react';

import './styles.scss';

export default function SearchBox({ results }) {
    console.log(results)

    return(
        <div className="search-container">
            <ul className="search-container__results">
                {
                    results.map((el, key) => (
                        <li className="search-container__results--el">
                            <p className="search-container__results--el--text">
                                {el.name}
                            </p>          
                        </li>
                    ))
                }
            </ul>
        </div>
    );
}
